import React from 'react';
import './SupportButton.css';

function SupportButton() {
  const handleClick = () => {
    console.log('Support clicked');
  };

  return (
    <button className="support-button" onClick={handleClick}>
      <svg className="button-icon" width="20" height="20" viewBox="0 0 20 20" fill="none" xmlns="http://www.w3.org/2000/svg">
        <path d="M10 2C5.58172 2 2 4.58172 2 9C2 10.5 2.5 11.9 3.3 13.1L2 18L6.9 16.7C8.1 17.5 9.5 18 11 18C15.4183 18 19 15.4183 19 11C19 6.58172 15.4183 4 11 4H10V2Z" fill="white"/>
        <circle cx="7" cy="9" r="1" fill="#1a0b2e"/>
        <circle cx="11" cy="9" r="1" fill="#1a0b2e"/>
        <circle cx="15" cy="9" r="1" fill="#1a0b2e"/>
      </svg>
      <span className="button-text">Поддержка</span>
    </button>
  );
}

export default SupportButton;
